import React, { useState } from "react";

import ButtonSmall from "../ButtonSmall/ButtonSmall";
import "./Feedback.css";

function Feedback() {
  const [feedbackOpen, setFeedbackOpen] = useState();
  return (
    <div className="feedback">
      <h3 className="feedback-h3">Hi! I'm still building this app.</h3> Please
      leave your feedback to help it get better:
      <form className="feedback-form" action="POST" netlify>
        <textarea
          className="task-input form-input"
          name="feedback-text"
          id="feedback-text"
          cols="30"
          rows="2"
          placeholder="Things I like... Things I don't like... Features I miss..."
        ></textarea>
        <ButtonSmall
          onClick={(e) => {
            e.preventdefault();
          }}
          title="submit"
          size="large"
          type="submit"
          color="red"
        />
      </form>
      <div className="task-btn-hide"></div>
    </div>
  );
}

export default Feedback;
